import { CopyToClipboard } from 'react-copy-to-clipboard';

function LinkResult(inputValue) {
    var shortLink = 'temp'

    return (
        <div className="result">
            <p>{shortLink}</p>
            <CopyToClipboard text={shortLink} onCopy={(changeShortLink(inputValue))}>
                <button type='button' className='btn'>Copy</button>
            </CopyToClipboard>
        </div>
    )


    function ShortenLink(inputValue1) {
        shortLink = inputValue1;
        }

}

export default LinkResult
function changeShortLink(shortenedLink){
    console.log('THERE')
    console.log(shortenedLink)
    LinkResult(shortenedLink)
}
